func TestLengthOfLongestSubstring1(t *testing.T) {
	o := NewGomegaWithT(t)

	r := lengthOfLongestSubstring("abcabcbb")

	o.Expect(r).To(Equal(3))
}

func TestLengthOfLongestSubstring2(t *testing.T) {
	o := NewGomegaWithT(t)

	r := lengthOfLongestSubstring("bbb")

	o.Expect(r).To(Equal(1))
}

